This soft ,succulent and full of flavourful spices lamb curry is my absolute favorite dish.
Mutton when perfectly cooked, just melts in your mouth. This curry is made with tomatoes and onions cooked with spices makes for a perfect weekend lunch or dinner.
I most enjoy this with raggi mudde and rice.

Quick Recipe:
Heat oil  in a pressure cooker,add cinnamon, cloves and bay leaf , sliced onion and fry until slightly browned.Add ginger and garlic paste.
Transfer the mutton in the pressure cooker and fry on high heat for 4-5 minutes now add curd and diced tomatoes and cook for 2-3 minutes.
Add green chillies, coriander powder, turmeric powder, red chilli powder,  cumin powder, garam masala powder and salt accordingly.
Finally add water depending how thick you want the curry and pressure cook until mutton is cooked( 4 to 5 whistles).Remove the cooker from heat and let the pressure release.Garnish with fresh coriander.Serve hot with rice,roti or raggi ball

