Pastry:
300g Plain Flour
75g Butter
75g Trex 
Cold water to bind
These measures are just to make the base of the tart. For the top I made extra.
1 Egg beaten to glaze top of pastry 

Filling:
2 Jars Strawberry Preserve Jam (puree)
Sponge

Instructions:
Butter your tart dish and lay out the pastry. To get a nice top finish roll your rolling pin over the top edges to trim off the excess pastry.
Refrigerate for 30 minutes before adding the sponge and jam.
Spread a thin layer of jam, cover with a thin layer of sponge and remaining jam. 
Make a lattice or any design with pastry and place on top of jam. Brush the pastry with beaten egg and bake in oven 180C/Gas 4 till pastry is cooked and golden on top. 
